webpackJsonp([0xdaefb179143a],{326:function(e,n){e.exports={data:{markdownRemark:{html:'<ol>\n<li><strong>Rename your local branch</strong></li>\n</ol>\n<p>If you are on the branch you want to rename</p>\n<pre><code class="language-bash">git branch -m new-name\n</code></pre>\n<p>If you are on a different branch</p>\n<pre><code class="language-bash">git branch -m old-name new-name\n</code></pre>\n<ol start="2">\n<li><strong>Delete the old-name remote branch and push the new-name local branch</strong></li>\n</ol>\n<pre><code class="language-bash">git push origin :old-name new-name\n</code></pre>\n<ol start="3">\n<li><strong>Reset the upstream branch for the new-name local branch</strong></li>\n</ol>\n<pre><code class="language-bash">git push origin -u new-name\n</code></pre>',frontmatter:{title:"Rename a local and remote branch in git",date:"December 12, 2017",path:"/rename-local-and-remote-branch-git",tags:["git","branch","branch names"],excerpt:""}}},pathContext:{prev:{html:'<p>Once upon a midnight dreary, while I pondered, weak and weary,\nOver many a quaint and curious volume of forgotten lore—\nWhile I nodded, nearly napping, suddenly there came a tapping\nAs of some one gently rapping, rapping at my chamber door—\n"\'Tis some visitor," I muttered, "tapping at my chamber door—\nOnly this and nothing more."</p>',id:"/Users/fernandomendoza/Proyectos/my-blog/src/pages/2017-12-11-the-raven/index.md absPath of file >>> MarkdownRemark",frontmatter:{date:"2017-12-11T23:59:29+00:00",path:"/the-raven",title:"The Raven",excerpt:"Only this and nothing more",tags:["poem","narrative","edgar allan poe","poe"]}},next:null}}}});
